inline double traverseTree(const TreeNode* tree, int tree_size, const double* x) {
    int node_id = 0;
    while (!tree[node_id].is_leaf) {
        if (x[tree[node_id].feature] < tree[node_id].threshold) {
            node_id = tree[node_id].left;
        } else {
            node_id = tree[node_id].right;
        }
    }
    return tree[node_id].value;
}

inline double predict(const double* features) {
    double sum = BASE_SCORE;
    for (int t = 0; t < N_TREES; t++) {
        sum += traverseTree(TREES[t], TREE_SIZES[t], features);
    }
    return sum;
}

